import React from 'react';
import '../pages/signup.css';
import profile from '../images/profile_pic.jpg'


export default function SignUp() {
  return (
      <div className='main'>
          <div className='sub-main'>
            <div>
                <div className='imgs'>
                    <div className='container-img'>
                        <img src={profile} alt='profile' />
                    </div>
                </div>
            </div>
          </div>

      </div>
  );
}
